package uk.tldcode.extraterrestrialprobemachine.plugins

import com.google.common.io.ByteStreams
import org.pircbotx.hooks.events.MessageEvent
import org.simpleframework.http.Request
import org.simpleframework.http.Response
import uk.tldcode.extraterrestrialprobemachine.api.KotlinCommand
import uk.tldcode.extraterrestrialprobemachine.api.Plugin
import uk.tldcode.extraterrestrialprobemachine.api.UserLevel
import java.util.stream.Collectors
import java.io.InputStreamReader
import java.io.BufferedReader



class SoundsPlugin(name:String) : Plugin(name){
    override fun Web(request: Request, response: Response) {
        if(request.path.extension == "js"){
            response.setValue("Content-Type", "application/javascript")
            val inputStream = this::class.java.getResourceAsStream("/sw.js")
            ByteStreams.copy(inputStream,response.outputStream)
        }else{
            response.setValue("Content-Type", "text/html")
            val inputStream = this::class.java.getResourceAsStream("/SoundsCommand.html")
            ByteStreams.copy(inputStream,response.outputStream)
        }

        response.outputStream.flush()
    }

    override fun Init() {
        WebSocket = WebSocketServer()
        Commands.put("WebSocket", object: KotlinCommand() {
            override fun invoke(event: MessageEvent, respond: (String) -> Unit) {
                val ogg = "data:audio/ogg;base64,"
                (WebSocket as WebSocketServer).sockets.onEach {it.value.send(ogg)  }
            }

            override fun UserLevel(event: MessageEvent): UserLevel = UserLevel.Caster

            override fun match(message: String): Boolean {
                return message.startsWith("!WebSocket")
            }
        })
    }

    override fun PostInit() {

    }

}